import React from 'react';
import styled from 'styled-components';


const Tbody = styled.tbody`
.tr {
    border-bottom: 1px solid #dddddd;
}

.td{
    padding: 12px 15px;
}
`;


const Customer = (props) => {
    return (

        <tr className="tr">
            <td className="td">
                {props.id}
            </td>
            <td className="td">
                {props.name}
            </td>
            <td className="td">
                {props.birthday}
            </td>
            <td className="td">
                {props.gender}
            </td>
            <td className="td">
                {props.job}
            </td>
        </tr>

    )
}



export default Customer;
